import hashlib
import re

html_text=""
new_text = ""
for s in re.findall('........', html_text):
    #print(chr(int(s, 2)))
    new_text += chr(int(s, 2))
print(new_text)
print("\n\n\n")
new_text = new_text.encode("utf-8") 
print(new_text)
st = str(hashlib.sha512(new_text).hexdigest())
print("\n\n\n")
print(st)